    on these data. The nominal point spacing is 1.2 meters. The following are the collection
    parameters and equipment used to create this data set: Aircraft: Piper Navajo (N6GR)
    and Cessna 320 (N3443Q) Lidar System: Optech ALTM Gemini (03SEN145 and 07SEN201)
    Approximate Collection Altitude (Above Mean Terrain): 1800 meters Ground Speed:
    150 kts Pulse Rate Frequency: 70 kHz Mirror Scan Frequency: 32 Hz Scan Angle (+/-):
    20 degrees Beam Divergence: Narrow (0.25 mrad) Accuracy statements are based on
    areas of moderate terrain, with points temporarily classified as ground. Diminished
    accuracies are to be expected in areas of extreme terrain and dense vegetation.
